        },
        {
            name: "Morty Smith",
            source: "https://static.wikia.nocookie.net/rickandmorty/images/a/a6/Rick_Sanchez.png/revision/latest/scale-to-width-down/350?cb=20160923150728"
        },
        {
            name: "Jerry Smith",
            source: "https://static.wikia.nocookie.net/rickandmorty/images/a/a6/Rick_Sanchez.png/revision/latest/scale-to-width-down/350?cb=20160923150728"
        },
        {
            name: "Summer Smith",
            source: "https://static.wikia.nocookie.net/rickandmorty/images/a/a6/Rick_Sanchez.png/revision/latest/scale-to-width-down/350?cb=20160923150728"
        },
        {
            name: "Doofus Rick",
            source: "https://static.wikia.nocookie.net/rickandmorty/images/a/a6/Rick_Sanchez.png/revision/latest/scale-to-width-down/350?cb=20160923150728"
        },
    ]
    );
    const [selections, setSelections] = useState([]);

    return(
        <div>
            <Header score={score} bestScore={bestScore}/>
            <hr></hr>
            <Content cards = { cards }/>
        </div>
    );
}

export default App
